import { Route, Routes } from 'react-router-dom'

// import LoginPage from './pages/login/LoginPage'
function App() {
  return (
    <Routes>
      <Route path='/' element={<Topbar />}></Route>
      <Route></Route>
      <LoginPage></LoginPage>
    </Routes>
  )
}

export default App
